import React from "react";
import styled from "styled-components";

export default function Navbar() {
  return (
    <MainContainer>
      <NavbarMainContainer>
        <LogoImg>
          <img
            src="/navbarimgcontainer/website_logo.png"
            alt="HouseHoldWebsite"
          />
        </LogoImg>
        <NavbarContent>
          <ul>
            <li>
              <a href="">Maintainance</a>
            </li>
            <li>
              <a href="">HouseHoldThing</a>
            </li>
            <li>
              <a href="">Medical Facilities</a>
            </li>
            <li>
              <a href="">About</a>
            </li>
          </ul>
        </NavbarContent>
      </NavbarMainContainer>
    </MainContainer>
  );
}

const MainContainer = styled.div`
  width: 100%;
`;

const NavbarMainContainer = styled.nav`
  width: 100%;
  display: flex;
  flex-direction: row;
  align-items: center;
`;

const LogoImg = styled.div`
  width: 5%;
  padding: 4px;
  margin: 2px;
  img {
    width: 100%;
    filter: invert(100%);
  }
`;

const NavbarContent = styled.div`
  width: 100%;
  ul {
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-evenly;

    list-style: none;

    li {
      font-family: "Alkatra", cursive;
      padding: 3px;
      margin: 5px;
      border: 2px solid white;
      border-radius: 4px;
      width: 12%;
      text-align: center;
      background-color: white;
      a {
        text-decoration: none;
        text-align: center;
        color: #472D2D ;
        font-size: 1.2rem;
        padding: 2px;
      }
    }
    li:hover{
        background-color: ;
        
    }

  }
`;
